import React, { Component } from "react";
import { Elements } from "react-stripe-elements";

import PaymentCheckoutForm from "./PaymentCheckoutForm";

class Payment extends Component {
  render() {
    return (
      <div>
        <Elements>
          <PaymentCheckoutForm />
        </Elements>
      </div>
    );
  }
}

export default Payment;
